import React, { useState } from "react";
import SignIn from "./components/SignIn";
import { Switch, Route } from "react-router-dom";
import Routes from "./components/Routes";
import "./App.css";

const App = () => {
   

  return (
    <>
      <Switch>
        <Route exact path="/">
          <SignIn />
        </Route>

        <Routes />
      </Switch>
    </>
  );
};
export default App;
